import styled from "../assets/styles";


export const Button = styled.button`
    position: absolute;
    width: 195px;
    height: 44px;
    cursor: pointer;
    background: #FFFFFF;
    border-radius: 5px;
    font-style: normal;
    font-weight: bold;
    font-size: 18px;
    line-height: 22px;
    color: #88DEAF;

`;
